import slider1 from './slider1.jpeg';
import slider2 from './slider2.jpeg';
import slider3 from './slider3.jpeg';
import descripcion from './descripcion.jpeg';
import familia from './familia.jpg';
import combos from './Combos.PNG';
import jabones from './Jabones.PNG';
import arcilla from './Arcilla.PNG';
import labiales from './labiales.PNG';



export default {
    "slider1": slider1,
    "slider2": slider2,
    "slider3": slider3,
    "descripcion": descripcion,
    "familia": familia,
    "combos": combos,
    "jabones": jabones,
    "arcilla": arcilla,
    "labiales": labiales

}
